import React from 'react';
import Head from 'next/head';
import Menu from '../componete/Menu.js';
import RodaPe from '../componete/RodaPe';

import { Jumbotron, Container, Form, FormGroup, Label, Button } from 'reactstrap';

function contato() {
    return (<div>
        <Head>
            <title>Contato</title>
            <meta name='robots' content='index, follow' />
            <meta name="description" content="Entre em contato com a Segunda Igreja Batista no Recanto das Emas-DF"></meta>
            <meta name="author" content="Ernilson Daniel Lima de Souza" />
        </Head>
        <Menu />
        <Jumbotron fluid className="head-contato">
            <style>{`.head-contato{
                padding-top: 80px;
                padding-buttom:20px;
                background-color: #fff;
                margin-bottom: 0ren ! important;
         }`}</style>
            <Container>
                <h1 className="display-4 text-center">Contato</h1>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="form-contato">
        <style>{`.head-contato{
                padding-top: 80px;
                padding-buttom:80px;
                background-color: #fff;
                margin-bottom: 0ren ! important;
         }`}</style>
            <Container>
                <div class="row featurette">
                    <div className="col-md-6">
                    <Form>
                        <FormGroup>
                            <Label for="nome">Nome:</Label>
                            <Input />
                        </FormGroup>
                    </Form>
                    </div>
                    <div className="col-md-6">
                        <h3 className="featurette-heading">Nossas atividade </h3>
                        <p className="lead">Domingos das 09:00 as 11:00 hrs, Quartas as 20:00hrs, Sexta as 16:00hrs.</p>
                        <hr /> 
                        <address>
                            <strong>Endereço</strong><br />
                            Quadra 105 Area Especial 01 <br />
                            Av. Vargem das Benção Recanto das Emas- DF<br />
                            (61)991323236 <br />
                        </address>
                    </div>
 
                </div>
            </Container>
        </Jumbotron>
         <RodaPe />
    </div>)
}

export default contato;
